collections::vec_deque::VecDeque::<T, A>.doc:
Returns the number of elements in the deque.

# Examples

```
use std::collections::VecDeque;

let mut deque = VecDeque::new();
assert_eq!(deque.len(), 0);
deque.push_back(1);
assert_eq!(deque.len(), 1);
